import React from 'react';
import './App.css';
import { Layout } from 'antd';

const { Header, Footer, Sider, Content } = Layout;


function App() {
  return (
    <div className="App">
      <Layout>
      <Header>Header</Header>
      <Layout>
      <Sider style={{background:"red"}}>Sider</Sider>
      </Layout>

      <Layout>
        <Content>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    </div>
  );
}

export default App;
